        return(
            <div className="row">
                <div className="col-4">

                </div>
                <div className="col-4">

                </div>
                <div className="col-4">

                </div>
            </div>
        )
    }
    componentDidMount(){
        fetch(mealtypeurl,{method:'GET'}).then((res) => res.json()).then((data) => {
            console.log(data)
        })
    }

}

export default QuickSearchDisplay
